INSERT INTO `tickets` (`id`, `subject`, `user_id`, `ticket_type_id`, `ticket_status_id`, `risen_from`, `customer_name`, `customer_phone_number`, `customer_address`, `division`, `product_batch_code`, `description`, `agent`, `created_by`, `updated_by`, `deleted_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, '', 2, 5, 4, 'Call Center', 'Mr. Mahedi Hasan', '1711047585', 'Dhaka', 'Dhaka', 'NA', 'The consumer inquired for DANO POWER  and he was asking- why Dano Power is not currently available in TIN.size which helps to preserve the powder in air tight condition, which is easier and convenient compared to BIB or foil pack  ', 'Prathama Ratno', NULL, NULL, NULL, NULL, '2018-01-25 08:54:45', '2018-01-28 10:47:51'),
(2, '', 2, 5, 4, 'Call Center', 'Ziaul Huque', '1918396312', 'Motijheel', 'Dhaka', '', 'Customer is asking. why ARLA has not yet entered into Bangladesh stock market', 'Mashyed Islam Shuchi', NULL, NULL, NULL, NULL, '2018-02-07 12:11:38', '2018-02-11 10:20:50'),
(3, '', 2, 6, 4, 'Call Center', 'Hasan', '1929676338', 'Mughda ', 'Dhaka', '1304052', 'As per Retailer - One of my consumer purchase Dano power full cream milk powder (shop name : Sufia Store).After opening the pack he found some bad smell then he return the pack to my shop.', 'Shakila Yasmin Tamanna', NULL, NULL, NULL, NULL, '2018-02-08 12:24:16', '2018-02-18 12:40:59'),
(4, '', 13, 6, 4, 'Call Center', 'Lincon Banna', '1670322667', 'Dhaka', 'Dhaka', '1316051', 'product details Dano Daily Pusti 500gm;Issue: while boiling it, he complained that it does not mix properly and its oiling on the above.', 'Prathama Ratno', NULL, NULL, NULL, NULL, '2018-02-13 07:26:47', '2018-02-18 11:21:22'),
(5, '', 2, 4, 4, 'Call Center', 'Roshul amin', '1824069112', 'Laksmipur,Jockshim bazar, Rahi store', 'Chittagong', '', 'Dealer name: Adit Pal\r\nDealer contact number could not provide.\r\nRetailer Roshul amin complained to us.He does not get his product from dealer in right time.So he cordially requested us please solve the problem or please change that dealer.', 'Mashyed Islam Shuchi', NULL, NULL, NULL, NULL, '2018-02-13 10:41:24', '2018-02-13 11:08:49'),
(6, '', 7, 5, 4, 'Call Center', 'muktar hossain', '1612733555', 'narayongong,polisline', 'Dhaka', '', 'As per consumer - after feeding my baby (Dano Power full cream milk powder) it tasted different and he is suffering from diarrhea.', 'Shakila Yasmin Tamanna', NULL, NULL, NULL, NULL, '2018-02-14 08:49:59', '2018-02-18 10:07:41'),
(7, '', 2, 4, 4, 'Call Center', 'mursed alam', '1721440809', 'laxmipur,noakhali', 'Chittagong', '', 'The person wants to take dealership in Laxmipur, Noakhali under Chittagong division.  Currently, he does not own a shop. He is expecting that, someone from ARLA will contact with him.', 'Prathama Ratno', NULL, 5, NULL, NULL, '2018-02-14 09:03:48', '2018-02-18 12:44:51'),
(8, '', 13, 6, 4, 'Call Center', 'Mr. Muktar Hossain', '1612733555', 'Police Line, Narayangonj', 'Dhaka', '', 'Product Dano Power SKU: 400gm, still have 80 percent of product and has kept with the consumer.\r\n\r\nConsumer has given the product to his 6 yrs old baby. As soon as the baby had the milk, the taste felt different and the baby got sick (dysentery). purchase', 'Super Akram', NULL, NULL, NULL, NULL, '2018-02-18 10:24:45', '2018-03-06 08:43:02'),
(9, '', 2, 4, 4, 'Call Center', 'Mr.Rafiqul Islam', '1811756179', 'Sonadanga, Boyra College Road, Khulna Dist.', 'Khulna', '', 'Retailer is complaining that, major Dano products are not available in his area. Only Dano Daily Pusti 400gm is available. According to the retailer , No SR/Dealer is communicating with them for the last 2 months.', 'Super Akram', NULL, NULL, NULL, NULL, '2018-02-18 12:18:14', '2018-02-19 06:13:43'),
(10, '', 2, 5, 4, 'Call Center', 'Mr. Auib Ali', '1914145424', 'Chuadanga', 'Khulna', '', 'The consumer wants to know that, Is dano power full cream milk powder made from cow\'s milk? The word \"cow\'s milk\" is not mentioned or written anywhere in the packet.', 'Super Akram', NULL, NULL, NULL, NULL, '2018-02-19 07:10:31', '2018-02-20 05:42:13'),
(11, '', 4, 5, 4, 'Call Center', 'Mohsin', '17584214966', 'Moheshkhali, Cox\'s Bazar', 'Chittagong', 'PBC-111', 'Mail Subject testing form IT, Ticket will be closed after testing', 'tester', NULL, NULL, NULL, NULL, '2018-02-20 07:45:21', '2018-02-20 07:49:18'),
(12, '', 2, 5, 4, 'Call Center', 'Mr. Abdus Sobur', '1916805018', 'General Store, Rupsha, Khulna kotoali Thana, Khulna', 'Khulna', 'Dano daily pusti ', 'Retailer is facing difficulties to sell  Dano Daily Pusti. Previously DDP 400gm\'s price was BDT 165, now with 75 less weight DDP 325gm\'s price is BDT 150, which is BDT 15 more than the usual. Retailer needs feedback.', 'Super Akram', NULL, 5, NULL, NULL, '2018-02-20 10:53:14', '2018-02-26 11:18:08'),
(13, '', 2, 4, 4, 'Call Center', 'Mr Sumon', '1839950707', 'Sumon Store, Middle Nandi Para, Khilgaon, Dhaka', 'Dhaka', '', 'The retailer is complaining that, he has not been getting any ARLA products in his shop for the last 1 month.', 'Super Akram', NULL, 5, NULL, NULL, '2018-02-20 12:02:54', '2018-03-06 05:27:39'),
(14, '', 2, 4, 4, 'Call Center', 'Mr. Mamun Khan', '1917230825', 'Maniknagar, Dhaka', 'Dhaka', '', 'The retailer received a sms from ARLA.\r\nThe content of the sms was something like \" dokan e 10KG Dano Display kore bujhe nin 400gm Dano Daily Pusti EKJON (it supposed to be EKDOM) free\".Shop Name: N/A.\r\n', 'Call Center', NULL, NULL, NULL, NULL, '2018-02-20 12:42:39', '2018-02-20 13:09:22'),
(15, '', 2, 4, 4, 'Call Center', 'Mr.Sohel rana', '1745629067', 'Fulchori Thana, Gaibandha District, Udaikhali union ', 'Rangpur', '', 'A retailer call us from Gaibandha district, He said if Dano arrange a (Display program) training about how to display the Dano product of his shop that would be very helpful for him.', 'Super Akram', NULL, NULL, NULL, NULL, '2018-02-24 04:42:39', '2018-02-26 11:41:19'),
