(17, 'Nutrient Value_Dano_Power', 2, 5, 4, 'Call Center', 'Dr. Abdul Kader; Deputy Director, Ministry of Health', '1710091086', 'Niketon, Gulshan-1, Dhaka', 'Dhaka', '', 'This valued consumer purchased Dano Power Full Cream Milk Powder on yesterday. According to the consumer, the nutrient value (Vitamin A & D) mentioned on the body of the packet is quite higher than compared to standard value. He wanted to say that, while ', 'Call Center', NULL, NULL, NULL, NULL, '2018-02-26 03:46:40', '2018-02-26 03:50:08'),
(18, 'Retailer_Wants to keep Dano Power', 2, 4, 1, 'Call Center', 'Mr. Rafiqul Islam', '1715485090', '\"Bhai Bhai Store\", Tungi para, Area Name: Baijeria, Gopalganj', 'Dhaka', '', 'Retailer is interested to keep Dano Power in his store. He has inquired about all Dano products through our hotline. ', 'Call Center', NULL, NULL, NULL, NULL, '2018-03-05 05:52:17', '2018-03-05 05:52:17'),
(19, 'Retailer_Unavailability of Dano Products', 2, 4, 1, 'Call Center', 'Mr. Mizan', '01915141876', '\"Mizan Store\", Chunkutia, Chowdhury Para, Keranigonj, Dhaka', 'Dhaka', '', 'Not getting any Dano Products since long. Local SR is delivering/distributing Dano products to other shops except his store.', 'Call Center', NULL, NULL, NULL, NULL, '2018-03-05 06:03:47', '2018-03-05 06:03:47'),
(20, 'Ticket', 2, 4, 4, 'Call Center', 'Mr. Salim', '1643309424', 'District-Sylhet, Thana- Airport, purbo subid bazar , Mia fazil chist goli sylhet. Fahim store', 'Sylhet', '', 'Retailer said he sale the Dano products since long but he did not get any types of offer yet so if possible than please provide him the sales incentive or other bonus.', 'Super Akram', NULL, NULL, NULL, NULL, '2018-03-06 06:26:35', '2018-03-12 08:35:07'),
