(25, 'About Dano daily pusti', 2, 6, 1, 'Call Center', 'Mrs. Sujib', '1719339348', 'Dhoregram,Manikgonj,Dhaka', 'Dhaka', 'Dano daily pusti', 'Consumer Mrs Sujib is using Dano daily pusti since long but two days before when she drink this Dano daily pusti she got totally different test. She said, I got too much sugar on it .So she wants to know the reason.', 'Super Akram', NULL, NULL, NULL, NULL, '2018-03-08 12:07:54', '2018-03-08 12:07:54'),
